import React from 'react';
import * as V from 'victory';

const data = [
    {quarter: 1, earnings: 13000},
    {quarter: 2, earnings: 16500},
    {quarter: 3, earnings: 14250},
    {quarter: 4, earnings: 19000}
  ];

export default class FetchData extends React.Component {
    state = {
        loading: true,
        json: {}
    };

    async componentDidMount() {
        const url = "https://covidtracking.com/api/us/daily";
        const response = await fetch(url);
        const data = await response.json();
        this.setState({loading: false, json: data});
        console.log(this.state.json[0]);
        console.log(typeof(this.state.json));
    }

    render() {
        return (
            <V.VictoryChart
            domainPadding={50}
            >
                <V.VictoryAxis
                    tickValues={[1, 2, 3, 4, 5]}
                    tickFormat={["Quarter 1", "Quarter 2", "Quarter 3", "Quarter 4", "Quarter 5"]}
                ></V.VictoryAxis>
                <V.VictoryAxis
                    dependentAxis
                ></V.VictoryAxis>
                <V.VictoryBar
                    // data={this.state.json}
                    // x="date"
                    // y="positive"
                    data={data}
                      x="quarter"
                      y="earnings" 
                />
            </V.VictoryChart>

            // <div>
            //     {this.state.loading ? <div>loading...</div> : <div>{this.state.json[0].death} deaths</div>}
            // </div>
        );
    }
}
